import React from "react";
import styles from "styles/announcementBar.module.css"

interface Announcement {
  announcement: string; 
}

const SecondaryHeaderLinks = (props: Announcement) => {
  return (
    <div className={styles.announcementBar}>{props.announcement}</div>
  );
};

export default SecondaryHeaderLinks;
